import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav style={{background:'#222',color:'#fff',padding:'12px 0',marginBottom:24}}>
      <div style={{maxWidth:1100,margin:'0 auto',display:'flex',gap:32,alignItems:'center'}}>
        <Link to="/" style={{color:'#fff',textDecoration:'none',fontWeight:'bold',fontSize:18}}>Home</Link>
        <Link to="/publicar" style={{color:'#fff',textDecoration:'none',fontWeight:'bold'}}>Publicar</Link>
  <Link to="/contacto" style={{color:'#fff',textDecoration:'none',fontWeight:'bold'}}>Contacto</Link>
  <Link to="/aviso-legal" style={{color:'#fff',textDecoration:'none',fontWeight:'bold'}}>Aviso Legal</Link>
      </div>
    </nav>
  );
}

export default Navbar;
